import {retrieveUserAccount} from '../../redux/actions/userActions'
import {Button} from 'antd'

const Hub = (props) => (
  <div>
  {props.loggedIn},{props.account.subdomain}
  <Button onClick={props.updateLogged}>Update the log</Button>
  </div>

)

export default Hub
